Ralph says a huge THANK YOU to Save Ralph writer/director Spencer Susser, puppet maker Andy Gent and the amazing team that brought Ralph to life and powerfully showed the world that no animal should suffer and die to test cosmetics or their ingredients. 

Click the link in our bio to join our #SaveRalph campaign to change laws and ban this cruelty once and for all 🚫🐰: hsi.org/saveralph 

