VICTORY 👏💗: Following HSI’s #SaveRalph campaign which generated over 1.3 million petition signatures, from people like YOU, Mexico has become the first country in North America to ban cosmetic animal testing!

We commend the Mexican Government and THANK all of our supporters for bringing us one bunny-leap closer to banning cosmetics-cruelty around the world! 🐰 Click on the link in our bio to learn more. 

